import Header from "./Header";
import Row from "./Row";

function ResultsTable(props) {
    return (
        <table>
            <Header data={props}/>
            {
                props.data.map((row) => {
                    return <Row row={row}/>
                })
            };
        </table>
    );
}

export default ResultsTable;
